import React, { useState } from 'react';
import { FaSearch, FaHome, FaList, FaShoppingBag, FaHistory } from 'react-icons/fa';
import './App.css'; // Import the CSS file

const productsData = [
    { id: 1, name: 'Everest Turmeric', price: 25 },
    { id: 2, name: 'Patanjali Turmeric Powder', price: 30 },
    { id: 3, name: 'Patanjali Sabji Masala', price: 40 },
    { id: 4, name: 'Patanjali Cumin (Jeera) Powder', price: 35 },
    // ... more products
];

const categoriesData = [
    { id: 1, name: 'Spices Or Masala' },
    { id: 2, name: 'Bathing Soaps' },
    { id: 3, name: 'Baby Care' },
    { id: 4, name: 'Hair Oil & Hair Cares' },
    { id: 5, name: 'Toothpaste & Toothbrush' },
    { id: 6, name: 'Shampoo & Conditioners' },
    { id: 7, name: 'Perfumes' },
    // ... more categories
];

function App() {
    const [searchTerm, setSearchTerm] = useState('');
    const [selectedCategory, setSelectedCategory] = useState(null);
    const [searchResults, setSearchResults] = useState([]);

    const handleSearchChange = (event) => {
        const term = event.target.value;
        setSearchTerm(term);

        // Filter products based on search term
        const results = productsData.filter((product) =>
            product.name.toLowerCase().includes(term.toLowerCase())
        );
        setSearchResults(results);
    };

    const handleCategoryClick = (category) => {
        setSelectedCategory(category);
        // Filter products based on selected category (implementation depends on your data structure)
        if (category.id === 1) { // Example: Spices Or Masala
            const filteredProducts = productsData.slice(0, 8); // Show first 8 for example
            setSearchResults(filteredProducts);
        } else {
            setSearchResults(productsData);  //Show all if not spices
        }

    };


    return (
        <div className="app-container">
            <header>
                <div className="search-bar" style={{ width: '100%' }}>
                    <input
                        type="text"
                        placeholder="Search for products..."
                        value={searchTerm}
                        onChange={handleSearchChange}
                    />
                    <button type="submit"> <FaSearch /></button>
                </div>
            </header>

            <div className="top-categories">
                <h2>Top Categories</h2>
                <div className="category-cards" style={{ overflowX: 'auto' }}>
                    {categoriesData.map((category) => (
                        <div key={category.id} className="category-card" onClick={() => handleCategoryClick(category)}>
                            <img src={`placeholder.png`} alt={category.name} />
                            <span>{category.name}</span>
                        </div>
                    ))}
                </div>
            </div>

            <div className="product-cards" style={{ overflowY: 'auto', maxHeight: '400px' }}>
                <h2>{selectedCategory ? selectedCategory.name : "All Products"}</h2>
                <div className="products">
                    {searchResults.map((product) => (
                        <div key={product.id} className="product-card">
                            <img src={`placeholder.png`} alt={product.name} />
                            <h3>{product.name}</h3>
                            <span>₹{product.price}</span>
                        </div>
                    ))}
                </div>
            </div>

            <footer>
                <nav>
                    <ul>
                        <li><a href="#"><FaHome /> Home</a></li>
                        <li><a href="#"><FaList /> Categories</a></li>
                        <li><a href="#"><FaShoppingBag /> Bag</a></li>
                        <li><a href="#"><FaHistory /> Orders</a></li>
                    </ul>
                </nav>
            </footer>
        </div>
    );
}

export default App;
